import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate, useLocation } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext.js';
import { CartProvider } from './context/CartContext.js';
import Navbar from './components/Navbar.js';
import Home from './pages/Home.js';
import Login from './pages/Login.js';
import Register from './pages/Register.js';
import RestaurantDetails from './pages/RestaurantDetails.js';
import Profile from './pages/Profile.js';
import Cart from './pages/Cart.js';
import Checkout from './pages/Checkout.js';
import OrderConfirmation from './pages/OrderConfirmation.js';
import Orders from './pages/Orders.js';
import DineOut from './pages/DineOut.js';
import OrderOnline from './pages/OrderOnline.js';
import ProtectedRoute from './components/ProtectedRoute.js';
import './App.css';

// AuthCheck component to handle global authentication checks
const AuthCheck = () => {
  const { isAuthenticated, loading } = useAuth();
  const location = useLocation();
  const navigate = useNavigate();

  useEffect(() => {
    // List of paths that require authentication
    const protectedPaths = ['/profile', '/cart', '/checkout', '/order-confirmation', '/orders'];

    // Current path
    const currentPath = location.pathname;

    // Check if current path is protected and user is not authenticated
    if (!loading && !isAuthenticated && protectedPaths.includes(currentPath)) {
      // Save the current location to redirect back after login
      navigate('/login', { state: { from: location } });
    }
  }, [isAuthenticated, loading, location, navigate]);

  return null; // This component doesn't render anything
};

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <Router>
          <div className="app">
            <AppContent />
          </div>
        </Router>
      </CartProvider>
    </AuthProvider>
  );
}

// Separate component to use hooks inside Router
function AppContent() {
  return (
    <>
      <AuthCheck />
      <Navbar />
      <main className="main-content">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/restaurants" element={<Home />} />
          <Route path="/restaurants/dine-out" element={<DineOut />} />
          <Route path="/restaurants/order-online" element={<OrderOnline />} />
          <Route path="/restaurants/category/:categoryId" element={<Home />} />
          <Route path="/restaurant/:id" element={<RestaurantDetails />} />

          {/* Protected Routes */}
          <Route path="/profile" element={
            <ProtectedRoute>
              <Profile />
            </ProtectedRoute>
          } />
          <Route path="/cart" element={
            <ProtectedRoute>
              <Cart />
            </ProtectedRoute>
          } />
          <Route path="/checkout" element={
            <ProtectedRoute>
              <Checkout />
            </ProtectedRoute>
          } />
          <Route path="/order-confirmation" element={
            <ProtectedRoute>
              <OrderConfirmation />
            </ProtectedRoute>
          } />
          <Route path="/orders" element={
            <ProtectedRoute>
              <Orders />
            </ProtectedRoute>
          } />
        </Routes>
      </main>
    </>
  );
}

export default App;
